    false,nt"url": null,nt"notes": "Breton Island, Louisiana Baseline (Geographic,
    NAD83) consists of vector line data that were input into the Digital Shoreline Analysis
    System (DSAS) version 4.0, which is computer software used to compute rate of change
    statistics. A baseline was acquired from the Barrier Island Comprehensive Monitoring
    Program (BICM) 2009 report (http://lacoast.gov/reports/project/3890772~1.pdf). The
    baseline included in the BICM report covered the entire Louisiana coastline, so
    the baseline representing Breton Island had to be clipped then exported to a new
    shapefile named Breton_Baseline.shp. The position relative to Breton Island was
    determined to be the best possible baseline to use for the study. The baseline file
    was used to create the transect files, which are required by the DSAS program to
    calculate rate of change statistics.",nt"license_title": null,nt"extras":
